import React, { Component } from 'react';
class ClientsPages extends Component {

    changeBack = () =>{
        this.props.changePages(false)
    }
    changeNext = () =>{
        this.props.changePages(true)
    }

    render() {

        return (<div>
            <button onClick={this.changeBack}>Previews</button>
            <button onClick={this.changeNext}>Next</button>
            <div>Page {this.props.pages.actual} of {this.props.length}</div>
            <input type="text" placeholder="Search"/>
            <select>
  <option value="volvo">Volvo</option>
  <option value="saab">Saab</option>
  <option value="mercedes">Mercedes</option>
  <option value="audi">Audi</option>
</select>
        </div>)
    }
}
export default ClientsPages;
